package com.team.worlds.user;

public class Profile_o {

	private String pf_userID ;
	private String pf_Img ;
	private String pf_bgImg ;
	private String pf_contents ;
	
	
	
	
	public Profile_o() {
		// TODO Auto-generated constructor stub
	}




	public Profile_o(String pf_userID, String pf_Img, String pf_bgImg, String pf_contents) {
		super();
		this.pf_userID = pf_userID;
		this.pf_Img = pf_Img;
		this.pf_bgImg = pf_bgImg;
		this.pf_contents = pf_contents;
	}




	public String getPf_userID() {
		return pf_userID;
	}




	public void setPf_userID(String pf_userID) {
		this.pf_userID = pf_userID;
	}




	public String getPf_Img() {
		return pf_Img;
	}




	public void setPf_Img(String pf_Img) {
		this.pf_Img = pf_Img;
	}




	public String getPf_bgImg() {
		return pf_bgImg;
	}




	public void setPf_bgImg(String pf_bgImg) {
		this.pf_bgImg = pf_bgImg;
	}




	public String getPf_contents() {
		return pf_contents;
	}




	public void setPf_contents(String pf_contents) {
		this.pf_contents = pf_contents;
	}
	
	
		
}
